import React, {Component} from 'react';
import Photo1 from './Photos/GoodFork1.jpeg'
import Photo2 from './Photos/GoodFork2.jpg'
import './Photo.css'

class Photo extends Component{
    render(){
        return(
            <div className="photo">
            <img src={Photo1} alt="photo1"/>

            </div>
        );
    }
}

export default Photo
